import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import SignInForm from '../components/landing_pages/signin_form';
import SignUpForm from '../components/landing_pages/signup_form';
import MainPages from '../components/main_pages/main_pages';
import PrivateRoutes from './private_routes';

export default function Routes() {
	return (
		<BrowserRouter>
			<Switch>
				<Route
					exact
					restricted={true}
					path="/"
					component={props => {
						return <SignUpForm {...props} />;
					}}
				/>
				<Route
					exact
					restricted={true}
					path="/sign-in"
					component={props => {
						return <SignInForm {...props} />;
					}}
				/>
				<PrivateRoutes
					exact
					path="/main-page"
					component={props => {
						return <MainPages {...props} />;
					}}
				/>
			</Switch>
		</BrowserRouter>
	);
}
